pragma solidity >=0.8.0;


contract Coin {

    address minter;

    mapping (address => uint) balances;

    event Send(address from , address to, uint value);


    constructor() {
        minter = msg.sender;

    }


    function mint(address owner, uint amount) public  {

        if (msg.sender != minter) return;
        balances[owner] += amount;

    }


}

